// frontend/src/components/MusicControls.jsx
import { useState, useEffect } from 'react';
import { musicManager, MUSIC_TRACKS } from '../utils/musicSystem';

export default function MusicControls() {
  const [currentTrack, setCurrentTrack] = useState(null);
  const [volume, setVolume] = useState(0.3);
  const [enabled, setEnabled] = useState(true);
  const [isPlaying, setIsPlaying] = useState(false);

  useEffect(() => {
    // Update current track info every second
    const interval = setInterval(() => {
      const track = musicManager.getCurrentTrack();
      setCurrentTrack(track);
      setIsPlaying(!!track);
    }, 1000);

    return () => clearInterval(interval);
  }, []);

  const handleVolumeChange = (e) => {
    const newVolume = parseFloat(e.target.value);
    setVolume(newVolume);
    musicManager.setVolume(newVolume);
  };

  const handleToggleEnabled = () => {
    const newEnabled = !enabled;
    setEnabled(newEnabled);
    musicManager.setEnabled(newEnabled);
  };

  const handleStop = () => {
    musicManager.stop(true);
  };

  const handlePlayTrack = (trackKey) => {
    musicManager.play(trackKey);
  };

  return (
    <div className="card">
      <div className="flex flex-between mb-md">
        <h4 style={{ margin: 0 }}>üéµ Background Music</h4>
        <label style={{ 
          display: 'flex', 
          alignItems: 'center', 
          gap: '10px',
          cursor: 'pointer' 
        }}>
          <input 
            type="checkbox" 
            checked={enabled} 
            onChange={handleToggleEnabled}
          />
          <span>{enabled ? "ON" : "OFF"}</span>
        </label>
      </div>

      {enabled && (
        <>
          {/* Current Track Display */}
          {currentTrack && (
            <div className="card" style={{
              backgroundColor: '#0a0a0a',
              marginBottom: '15px',
              border: '2px solid #ffd700'
            }}>
              <div className="flex flex-between" style={{ alignItems: 'center' }}>
                <div>
                  <div style={{ fontSize: '14px', fontWeight: 'bold', marginBottom: '5px' }}>
                    Now Playing:
                  </div>
                  <div className="text-primary" style={{ fontSize: '16px' }}>
                    üé∂ {currentTrack.name}
                  </div>
                </div>
                <button 
                  onClick={handleStop}
                  className="btn btn-danger btn-sm"
                >
                  ‚èπÔ∏è Stop
                </button>
              </div>
            </div>
          )}

          {/* Volume Control */}
          <div className="mb-md">
            <label style={{ display: 'block', marginBottom: '8px' }}>
              üîä Volume: {Math.round(volume * 100)}%
            </label>
            <input
              type="range"
              min="0"
              max="1"
              step="0.05"
              value={volume}
              onChange={handleVolumeChange}
              style={{
                width: '100%',
                cursor: 'pointer',
                accentColor: '#ffd700'
              }}
            />
          </div>

          {/* Manual Track Selection */}
          <details>
            <summary style={{ 
              cursor: 'pointer', 
              padding: '10px',
              backgroundColor: '#2a2a2a',
              borderRadius: '8px',
              marginBottom: '10px'
            }}>
              üéº Manual Track Selection
            </summary>

            <div className="grid grid-2" style={{ gap: '8px', marginTop: '10px' }}>
              {Object.entries(MUSIC_TRACKS).map(([key, track]) => (
                <button
                  key={key}
                  onClick={() => handlePlayTrack(key)}
                  className={currentTrack?.key === key ? 'btn btn-primary btn-sm' : 'btn btn-ghost btn-sm'}
                  style={{ 
                    fontSize: '12px',
                    padding: '8px 12px',
                    textAlign: 'left'
                  }}
                >
                  {track.name}
                </button>
              ))}
            </div>
          </details>

          {!isPlaying && (
            <p className="text-muted" style={{ 
              fontSize: '12px', 
              fontStyle: 'italic',
              marginTop: '10px',
              marginBottom: 0 
            }}>
              üí° Music will play automatically based on the scene
            </p>
          )}
        </>
      )}
    </div>
  );
}
